export const addAllCartItems = (cartItems) => {
    return {
        type: 'ADD_ALL_CART_ITEMS',
        payload: cartItems
    }
}
export const addAllItems = (airItems) => {
    return {
        type: 'ADD_ALL_ITEMS',
        payload: airItems
    }
}
export const addNewItem = (cartItem) => {

    return {
        type: 'ADD_NEW_ITEM',
        payload: cartItem
    }
}
export const addNewOrderC = (orderC) => {
    return {
        type: 'ADD_NEW_ORDER_CONF',
        payload: orderC
    }
}
export const delItem = (cartItem) => {

    return {
        type: 'DEL_ITEM',
        payload: cartItem
    }
}
export const addOrder = (cartItem) => {

    return {
        type: 'ADD_ORDER',
        payload: cartItem
    }
}
